    const enviarDatos = (datos) => {
        window.showSpinner(true);
        let data;

        data = {
            "data": {
                "type": 'migracion-datos-interesado',
                "attributes": {
                    "tipo_interesado": datos.tipo_interesado,
                    "tipo_sujeto_procesal": datos.descritipo_sujeto_procesalpcion,
                    "primer_nombre": datos.primer_nombre,
                    "segundo_nombre": datos.segundo_nombre,
                    "primer_apellido": datos.primer_apellido,
                    "segundo_apellido": datos.segundo_apellido,
                    "tipo_documento": datos.tipo_documento,
                    "numero_documento": datos.numero_documento,
                    "email": datos.email,
                    "telefono": datos.telefono,
                    "telefono2": datos.telefono2,
                    "cargo": datos.cargo,
                    "orientacion_sexual": datos.orientacion_sexual,
                    "sexo": datos.sexo,
                    "direccion": datos.direccion,
                    "departamento": datos.departamento,
                    "ciudad": datos.ciudad,
                    "localidad": datos.localidad,
                    "entidad": datos.entidad,
                    "sector": datos.sector,
                    "radicado": radicado,
                    "vigencia": vigencia,
                    "item": item,
                }
            }
        }

        GenericApi.addGeneric("migrar-interesados",data).then(
            datos => {
                if (!datos.error) {
                    setModalState({ title: "SINPROC No "+radicado+" :: Crear interesado", message: 'Registro Exitoso', show: true, redirect: `/ProcesoDisciplinarioMigracion/${radicado}/${vigencia}`, alert: global.Constants.TIPO_ALERTA.EXITO});
                }
                else {
                    setModalState({ title: "SINPROC No "+radicado+" :: Crear interesado", message: datos.error.toString(), show: true, redirect: `/ProcesoDisciplinarioMigracion/${radicado}/${vigencia}`, alert: global.Constants.TIPO_ALERTA.ERROR });
                }
                window.showSpinner(false);

            }
        )
    }

    return (
